import styled from "styled-components";

const Historic = styled.div`
    width: 2 vw;
    height: 200px;
    display: flex;
    backgroud-color: #ffffff;
    flex-direction: column;
    align-items: center;
    justify-content: center;


    margin: 30px 0 25px;
`;

export default Historic;
